import React from 'react';
import './Header.css';

function Header() {
    return (
        <div className="header">
            <div className="logo">
                JASON MARTIN
            </div>
            <div className="navbar">
                <a href="/">Home</a>
                <a href="/about">About</a>
                <a href="/resume">Resume</a>
                <a href="/portfolio">Portfolio</a>
            </div>
            <div className="contact">
                <p>Phone: (774) 565-3021</p>
            </div>
        </div>
    );
}

export default Header;
